import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./style.css";

const Button = (props) => {
  var towch;
  towchdarah = () => {
    if (document.getElementById("button_txt").innerHTML === "Submit") {
      props.onclk();
    }
  };
  if (props.txt === "Back") {
    towch = (
      <Link to="/" className="row">
        <button className="button" onClick={towchdarah}>
          <span id="button_txt">Back</span>
        </button>
      </Link>
    );
  } else {
    towch = (
      <button className="button" onClick={towchdarah}>
        <span id="button_txt">Submit</span>
      </button>
    );
  }
  return <div>{towch}</div>;
  Button.defaultProps = {
    txt: "Submit",
  };
};

export default Button;
